export const terms:string[] = Object.keys(searchMeta);

function startsWith(str:string, term:string): boolean {
    return term === str.substr(0, term.length);
}

function bsearch(searchElement:string, collection:string[]):number {
    let minIndex:number = 0;
    let maxIndex:number = collection.length - 1;
    let currentIndex:number;
    let currentElement:string;
    const seachElementLength = searchElement.length;
    searchElement = searchElement.toLowerCase();

    while (minIndex <= maxIndex) {
        currentIndex = (minIndex + maxIndex) / 2 | 0;
        currentElement = collection[currentIndex];

        if(startsWith(currentElement, searchElement)) {
            return currentIndex
        } else if(currentElement.localeCompare(searchElement) < 0) {
            minIndex = currentIndex + 1;
        } else {
            maxIndex = currentIndex - 1;
        }
    }

    return -1;
}

export function searchShortnames(term:string):string[] {
    const results:string[] = [];

    //search for [partial] match
    const i: number = bsearch(term, terms);
    if(i >= 0) {
        //seed initial hit
        results.push(...searchMeta[terms[i]]);

        //grab all elements that match below
        for(let b=i-1; b>=0 && startsWith(terms[b], term);b--) {
            results.push(...searchMeta[terms[b]]);
        }

        //grab all the elements that match above
        for(let a=i+1; a<terms.length && startsWith(terms[a], term);a++) {
            results.push(...searchMeta[terms[a]]);
        }
    }

    return results;
}
